import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-registerusuario',
  templateUrl: './registerusuario.component.html',
  styleUrls: ['./registerusuario.component.css']
})
export class RegisterusuarioComponent {
  nombres: string;
  correo: string;
  telefono: string;
  cedula: string;
  contrasena: string;

  constructor(private http: HttpClient) { }

  submitForm() {
    const formData = {
      nombres: this.nombres,
      correo: this.correo,
      telefono: this.telefono,
      cedula: this.cedula,
      contrasena: this.contrasena
    };

    this.http.post('/usuarios', formData).subscribe(
      response => {
        console.log('Solicitud POST enviada correctamente', response);
        // Realiza cualquier acción adicional que desees, como mostrar una notificación o redirigir al usuario.
      },
      error => {
        console.error('Error al enviar la solicitud POST', error);
        // Maneja cualquier error que pueda ocurrir, como mostrar un mensaje de error al usuario.
      }
    );
  }
}
